            <div  className="v_main">
             <TwoCardProduct />
             <TwoCardProduct />
             
            </div>
            <div  className="v_main">
             <TwoCardProduct />
             <TwoCardProduct />
             
            </div>
        </div>

        </>
    );
}

export default TwoCard;
